import React from "react";
import logo from "./logo.svg";
import "./App.css";

function GetJson() {
  return [
    {
      name: "test",
    },
    {
      name: "ed",
    },
  ];
}

function App() {
  let data = GetJson();

  return (
    <div>
      <ul>
        {data.map((item) => {
          return <li>{item.name}</li>;
        })}
      </ul>
    </div>
  );
}

export default App;
